const ButtonFactory = {

    homeButton: $("<button class='homeButton'></button>")
        .on('click', function () {
            if (document.getElementById("intro") === null) window.location.href = "";

        }),

    menuButton: $(`<img src='${getResourceURL("public/images/SettingsButton.png")}' class='settingsButton noselect'  alt=""/>`)
        .on('click', function () {

        }),

    ipBlockButton: (unhashedAddress) => {
        return $(`
                    <button value="${unhashedAddress}" class="ipBlockButton">(Block IP Address)</button>`
        ).get(0);
    },

    ipUnblockButton: (unhashedAddress) => {
        return $(
                `<button value="${unhashedAddress}" class="ipUnblockButton">(Unblock IP)</button>`
        ).get(0);
    },

    screenshotButton: (elementId) => {
        return $(
            `<img src="data:image/png;base64,"
                       id="${elementId}"
                       style="visibility: hidden;"
                       class="noselect"
                       alt="Screenshot Button">`
        )
    },

    fullscreenButton: (elementId) => {
        return $(
            `<img src="data:image/png;base64,"
                id="${elementId}" 
                       style="display: none;" 
                       class="videoScreenshotButton noselect"
                       alt="Fullscreen">`
        )
    },

    popoutButton: (elementId) => {
        return $(
            `<img src="data:image/png;base64,"
                id="${elementId}" 
                       style="display: none;" 
                       class="videoScreenshotButton noselect"
                       alt="Fullscreen">`
        )
    },

    endChatSrc: "data:image/png;base64,",
    startChatSrc: "data:image/png;base64,"
}

